/* eslint-disable no-unused-vars */
import { useState } from 'react';
import * as BookAPI from './BooksAPI.js';

const Output = ({setResult}) =>{
    const SearchResult = async () =>{
        const data = await BookAPI.search('react', 2);
        setResult(data);
        console.log(data);
        return data;
    };
SearchResult();
}
export default Output;
